import React from "react";

function Summaryorder() {
  return (
    <div>
      <div
        style={{
          position: "absolute",
          textAlign: "center",
          top: "100%",
          left: "40%",
        }}
      >
        <img src={HeroDesign} alt="" />
        <h3
          style={{
            position: "absolute",
            textAlign: "center",
            top: "40%",
            left: "15%",
          }}
        >
          Are you ready to eat?
        </h3>
        <Link to={"/details"}>
          <Button
            variant="contained"
            color="success"
            style={{
              position: "absolute",
              textAlign: "center",
              top: "60%",
              left: "30%",
            }}
          >
            Let's EAT
          </Button>
        </Link>
      </div>
    </div>
  );
}

export default Summaryorder;
